import { Component, Inject, Vue } from "vue-property-decorator";
import HelloWorld from "@/components/HelloWorld.vue"; // @ is an alias to /src
import * as signalR from "@aspnet/signalr";
@Component({
  components: {
    HelloWorld,
  },
})
export default class Home extends Vue {
  public status: string = "Chưa login";
  public user: string = "";
  public check: string = "";
  public check2: string = "";
  public message: string = "";
  public listMessage: any = [];

  public connection = new signalR.HubConnectionBuilder()
    // .withUrl('https://localhost:5001/signalr')
    //https://signalv4.cloudlms.top/hubs/authen
    //http://localhost.cloudlms.top:5009
    .withUrl(
      "http://localhost.cloudlms.top:5009/hubs/authen?access_token=eyJhbGciOiJSUzI1NiIsImtpZCI6IjhBNTIxNUQwRjc5MTgzQTlFRDBEMjVBRkQ1REYyRjI5IiwidHlwIjoiYXQrand0In0..Bbkbcrrzu5fqvWlT50i150UocHnaHZ7WvEpoCEwwNPIsa1-WZxtC-sfkwyljJB-0SJdmjizd7U1AXp-rnH0bu9B6pT_AEEg_fSdZzZoW3njSJjg7iGgvmf9VGW6ameiS6vdJfAOkTR7jR5ymAk4cSXoqdcdtipIuxaWmyuqaHxwoM-5axt37SmfA5o3x8mNj75lhV9ia3g2wAnChjWCr8HF7QTCvdEBLxDs2Z-XHVuhRVAOThc3ux8y8zbEoeK1bgJ9Xil5JKXF7vuCTF7m5cmXJgO10uacOhby8nFvOmdFVvHsFMvx5ORo_-bNxlP02w2RHHF-mTgcEM_NPzhXImQ"
    )
    .build();
  public mounted() {
      console.log("mounted : ");
    this.connection.on("AnotherUserLogin", (user: string) => {
      //   const insertdata = {name: user, message: "da ok"};
      //    this.listMessage.push(insertdata);
      console.log("Login success : " + user);
    });
  }

  public SignalR() {
     console.log("vao signal");
    if (this.connection.state === signalR.HubConnectionState.Connected) {
      this.connection.invoke("UserLogin");
    } else {
      this.connection.start().then(() => this.connection.invoke("UserLogin"));
        console.log("login ok la");
    }
  }

  public Clear() {
    this.listMessage = [];
  }

  // public meomeo() {
  //     this.status = "Đã login";
  //  console.log("hello");
  // }
}
